const T0DoListItems = (props) => {
  const deletItemsHandler = () => {
    console.log("Deleted");
  };

  return (
    <div>
      <div className="delet__btn">
        <i className="fa-solid fa-trash" onClick={deletItemsHandler}></i>
        <li> {props.list} </li>
      </div>
    </div>
  );
};

export default T0DoListItems;
